import React, { useState, useEffect } from 'react';
import Navbar from './Navbar';

function AddDoctorPage() {
  const [docName, setDocName] = useState('');
  const [docEmail, setDocEmail] = useState('');
  const [docPhoneNo, setDocPhoneNo] = useState('');
  const [experience, setExperience] = useState('');
  const [bio, setBio] = useState('');
  const [consultationFee, setConsultationFee] = useState('');
  const [tagId, setTagId] = useState('');
  const [specialties, setSpecialties] = useState([]);
  const [selectedSpecialties, setSelectedSpecialties] = useState([]);
  const [qualifications, setQualifications] = useState([]);
  const [selectedQualifications, setSelectedQualifications] = useState([]);
  const [practices, setPractices] = useState([]);
  const [selectedPractices, setSelectedPractices] = useState([]);
  const [tags, setTags] = useState([]);
  const [message, setMessage] = useState('');

  // Fetch Tags
  useEffect(() => {
    fetch('http://localhost:8080/api/tags')
      .then(res => res.json())
      .then(data => setTags(data))
      .catch(err => console.error(err));
  }, []);

  // Fetch Specialities
  useEffect(() => {
    fetch('http://localhost:8080/api/specialities')
      .then(res => res.json())
      .then(data => setSpecialties(data))
      .catch(err => console.error(err));
  }, []);

  // Fetch Qualifications
  useEffect(() => {
    fetch('http://localhost:8080/api/qualifications')
      .then(res => res.json())
      .then(data => setQualifications(data))
      .catch(err => console.error(err));
  }, []);

  // Fetch Practices
  useEffect(() => {
    fetch('http://localhost:8080/api/practices')
      .then(res => res.json())
      .then(data => setPractices(data))
      .catch(err => console.error(err));
  }, []);

  // Handler for Specialties checkboxes
  const handleCheckboxSpecialties = (e, id) => {
    if (e.target.checked) {
      setSelectedSpecialties(prev => [...prev, id]);
    } else {
      setSelectedSpecialties(prev => prev.filter(item => item !== id));
    }
  };

  // Handler for Qualifications checkboxes
  const handleCheckboxQualifications = (e, id) => {
    if (e.target.checked) {
      setSelectedQualifications(prev => [...prev, id]);
    } else {
      setSelectedQualifications(prev => prev.filter(item => item !== id));
    }
  };

  // Handler for Practices checkboxes
  const handleCheckboxPractices = (e, id) => {
    if (e.target.checked) {
      setSelectedPractices(prev => [...prev, id]);
    } else {
      setSelectedPractices(prev => prev.filter(item => item !== id));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const doctorData = {
      docName,
      docEmail,
      docPhoneNo,
      experience: parseInt(experience),
      bio,
      consultationFee: parseFloat(consultationFee),
      tagId,
      specialtyIds: selectedSpecialties,
      qualificationIds: selectedQualifications,
      practiceIds: selectedPractices
    };

    try {
      const response = await fetch('http://localhost:8080/api/doctors', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(doctorData)
      });
      if (!response.ok) {
        throw new Error('Error adding doctor');
      }
      await response.json();
      setMessage('Doctor added successfully!');
      // Reset the form
      setDocName('');
      setDocEmail('');
      setDocPhoneNo('');
      setExperience('');
      setBio('');
      setConsultationFee('');
      setTagId('');
      setSelectedSpecialties([]);
      setSelectedQualifications([]);
      setSelectedPractices([]);
    } catch (error) {
      console.error(error);
      setMessage('Error adding doctor.');
    }
  };

  return (
    <div>
      <Navbar />
      <div className="container mx-auto p-8">
        <h2 className="text-3xl font-bold mb-6">Add Doctor</h2>
        {message && <p className="mb-4 text-green-600">{message}</p>}
        <form onSubmit={handleSubmit} className="space-y-6 bg-white p-6 rounded shadow">
          <div>
            <label className="block mb-2 font-medium">Doctor Name</label>
            <input
              type="text"
              value={docName}
              onChange={(e) => setDocName(e.target.value)}
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-600"
              required
            />
          </div>
          <div>
            <label className="block mb-2 font-medium">Email</label>
            <input
              type="email"
              value={docEmail}
              onChange={(e) => setDocEmail(e.target.value)}
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-600"
              required
            />
          </div>
          <div>
            <label className="block mb-2 font-medium">Phone No</label>
            <input
              type="text"
              value={docPhoneNo}
              onChange={(e) => setDocPhoneNo(e.target.value)}
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-600"
              required
            />
          </div>
          <div>
            <label className="block mb-2 font-medium">Experience (years)</label>
            <input
              type="number"
              value={experience}
              onChange={(e) => setExperience(e.target.value)}
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-600"
              required
            />
          </div>
          <div>
            <label className="block mb-2 font-medium">Bio</label>
            <textarea
              value={bio}
              onChange={(e) => setBio(e.target.value)}
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-600"
              required
            />
          </div>
          <div>
            <label className="block mb-2 font-medium">Consultation Fee</label>
            <input
              type="number"
              step="0.01"
              value={consultationFee}
              onChange={(e) => setConsultationFee(e.target.value)}
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-600"
              required
            />
          </div>
          <div>
            <label className="block mb-2 font-medium">Tag</label>
            <select
              value={tagId}
              onChange={(e) => setTagId(e.target.value)}
              className="w-full p-3 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-600"
              required
            >
              <option value="">Select Tag</option>
              {tags.map((tag) => (
                <option key={tag.id} value={tag.id}>
                  {tag.tagName}
                </option>
              ))}
            </select>
          </div>
          {/* Specialties */}
          <div>
            <label className="block mb-2 font-medium">Specialties</label>
            <div className="grid grid-cols-2 gap-4">
              {specialties.map((spec) => (
                <label key={spec.id} className="flex items-center space-x-2">
                  <input
                    type="checkbox"
                    value={spec.id}
                    checked={selectedSpecialties.includes(spec.id)}
                    onChange={(e) => handleCheckboxSpecialties(e, spec.id)}
                    className="form-checkbox h-5 w-5 text-blue-600"
                  />
                  <span>{spec.specialityName}</span>
                </label>
              ))}
            </div>
          </div>
          {/* Qualifications */}
          <div>
            <label className="block mb-2 font-medium">Qualifications</label>
            <div className="grid grid-cols-2 gap-4">
              {qualifications.map((qual) => (
                <label key={qual.id} className="flex items-center space-x-2">
                  <input
                    type="checkbox"
                    value={qual.id}
                    checked={selectedQualifications.includes(qual.id)}
                    onChange={(e) => handleCheckboxQualifications(e, qual.id)}
                    className="form-checkbox h-5 w-5 text-blue-600"
                  />
                  <span>{qual.qualName}</span>
                </label>
              ))}
            </div>
          </div>
          {/* Practices */}
          <div>
            <label className="block mb-2 font-medium">Practices</label>
            <div className="grid grid-cols-2 gap-4">
              {practices.map((practice) => (
                <label key={practice.practiceId} className="flex items-center space-x-2">
                  <input
                    type="checkbox"
                    value={practice.practiceId}
                    checked={selectedPractices.includes(practice.practiceId)}
                    onChange={(e) => handleCheckboxPractices(e, practice.practiceId)}
                    className="form-checkbox h-5 w-5 text-blue-600"
                  />
                  <span>{practice.practiceName}</span>
                </label>
              ))}
            </div>
          </div>
          <button type="submit" className="w-full bg-blue-600 text-white px-6 py-3 rounded hover:bg-blue-700 transition">
            Submit
          </button>
        </form>
      </div>
    </div>
  );
}

export default AddDoctorPage;
